    dp = [[float('inf')] * (n + 1) for _ in range(m)]

    for i in range(n+1):
        dp[i][0] = 0
    for j in range(m):
        dp[j][0] = grid[0][j]
    for k in range(1, m):
        dp[k][0] = max(dp[k-1][0], dp[k][0]) + 1

    for i in range(n+1):
        for j in range(m):
            if i == 0 or j == 0:
                dp[i][j] = grid[i][j]

            elif dp[i - 1][j] != grid[i][j]:
                dp[i][j] = dp[i-1][j] + grid[i][j]

    return [x for x in range(m) if x not in dp[:k]]
